import React from 'react';
import k from './MyPosts.module.css'

const MyPosts = () => {
    return (
        <div>
          My posts
          <div className = {k.posts}>
            New post
          </div>
          <div className = {k.item}>
            post1
          </div>
          <div className = {k.item}>
            post2
          </div>
        </div>
    );
}

export default MyPosts;
